.top-header {
  position: fixed;
  left: 0;
  top: 0;
  width: 100%;
  color: #fff;
  height: 56px;
  background: #3f51b5;
  padding-left: 260px;
  transition: padding-left 0.2s ease-in-out, background-color 0.2s cubic-bezier(0.4, 0, 0.2, 1), box-shadow 0.15s linear;
  z-index: 30;
  height: 56px !important;
  padding-top: 3px;
}

.iconfont {
  font-size: 32px;
}

.icon-caidan, .icon-guanbi {
  font-size: 24px;
}

.search-ico {
  font-size: 24px;
  padding-right: 11px;
}

.search-input >>> input {
  border-radius: 2rem;
}

.search-input {
  width: 100%;
}

.search-popper {
  .el-autocomplete-suggestion__wrap {
    margin-bottom: 0px !important;

    li:not(lastChild) {
      border-bottom: 1px solid;
      margin-bottom: 5px;
    }
  }

  .name {
    border-radius: 5px;
    padding: 0 11px;
    background-color: #3f51b5;
    white-space: nowrap;
    overflow: hidden;
    color: white;
    text-overflow: ellipsis;
  }

  .addr {
    border-radius: 5px;
    padding: 0 11px;
    margin: 0;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
  }

  .addr-active {
    background-color: #6973a8;
    border-radius: 3px;
    color: #fff;
    padding: 0 3px 0 2px;
    margin-left: 11px;
  }

  .addr-last {
    padding-left: 0;
  }
}
